import React from 'react';
import propTypes from 'prop-types';

export const Quizname = ({ title }) => {
  return (
    <h1
      style={{
        fontSize: '30px',
        textAlign: 'center'
      }}
    >
      {title}
    </h1>
  );
}

Quizname.propTypes = {
  title: propTypes.func
};
